import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'Electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Trigger search by simulating pressing Enter
    await page.keyboard.press('Enter');
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_suggestions.png'));

    // Click on the first suggestion
    await page.click('.suggestion-item:first-child');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_first_suggestion.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_first_suggestion.png'));

    // Verify search results
    const resultsCount = await page.evaluate(() => {
      const results = document.querySelectorAll('.product-card');
      return results.length;
    });

    return {
      success: true,
      action: "Performed search and selected first suggestion",
      extractedData: { resultsCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
